/**
 * 한글이름 Naver 영문변환 서비스 이용 전환정보 파일저장.
 */
 
 // 파일출력용 내용
let printText = '';

/**
 * 한글이름 영문변환 Naver 서비스요청.
 * ※ 프록시설정 사이트 : https://cors-anywhere.herokuapp.com/corsdemo
 */
async function fetchConverEngName(lastName, hanName, fileDownReqAt) {
	const encHanName = encodeURI(lastName+hanName);
	const proxyUrl = 'https://cors-anywhere.herokuapp.com/'
	const feedUrl = `https://dict.naver.com/name-to-roman/translation/?query=${encHanName}&x=0&y=0&where=name`;
	
	// 프록시를 통해 정보 조회
	const response = await fetch(proxyUrl + feedUrl, {headers: {"X-Requested-With": "XMLHttpRequest"}});
	const htmlText = await response.text();
	
	const tbodyHtml = htmlText.substring(htmlText.indexOf('<tbody>'), htmlText.indexOf('</tbody>')+'</tbody>'.length)
	let extractNameList = tbodyHtml.match(new RegExp(/"([a-zA-Z ]*)"/, "g"));
	extractNameList.forEach(function(el, index){
		extractNameList[index] = el.replaceAll('"', '').split(' ')[1];
	});
	//console.log(hanName + '\t' + extractNameList.join(','));
	printText += (printText == '' ? '' : '\n') + hanName + '\t' + extractNameList.join(',');
	
	if( fileDownReqAt ){
		fncFileDownload();
	}
}

/**
 * Download HTML Template Source
 */
function downloadTemplate(filename, text) {
    let element = document.createElement('a');
    element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(text));
    element.setAttribute('download', filename);

    element.style.display = 'none';
    document.body.appendChild(element);

    element.click();

    document.body.removeChild(element);
}

/**
 * addEventListener
 */
document.addEventListener('DOMContentLoaded', ()=>{
    downloadTemplate('source.html', document.documentElement.outerHTML); //현재 웹페이지 전체 소스 선택
});

/**
 * 파일다운로드
 */
function fncFileDownload(){
	console.log('파일다운로드 처리');
	let element = document.createElement('a');
    element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(printText));
    element.setAttribute('download', 'convertEngNameList.txt');
    element.style.display = 'none';		//하이퍼링크 요소가 보이지 않도록 처리
    document.body.appendChild(element);	//DOM body요소에 하이퍼링크 부착
    element.click();					//클릭 이벤트 트리거 - 이 시점에 다운로드 발생
    document.body.removeChild(element);	//하이퍼링크 제거
}

